import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
  preview: {
    width: '100%',
    height: '100%',
    borderRadius: 16,
    backgroundRepeat: 'no-repeat',
    backgroundSize: 'cover',
    backgroundPosition: 'center center',
    minHeight: 281
  }
})

export default useStyles
